const generateMockCopilotResponse = (question: string): string => {
    const lowerCaseQuestion = question.toLowerCase();
    if (lowerCaseQuestion.includes("why") && lowerCaseQuestion.includes("spike")) {
        return "The cost spike was mainly due to a surge in EC2 usage for a temporary data processing task. Using Spot Instances for such jobs could offer significant savings in the future.";
    }
    if (lowerCaseQuestion.includes("optimize") || lowerCaseQuestion.includes("save")) {
        return "To optimize costs, I recommend looking into a few key areas:\n1.  **EC2 Right-Sizing:** Ensure your instances match their workload demands.\n2.  **Storage Tiering:** Move infrequently accessed S3 data to cheaper storage classes like S3 Infrequent Access or Glacier.\n3.  **Savings Plans:** If you have consistent compute usage, committing to a 1 or 3-year Savings Plan can provide large discounts on EC2 and Lambda.";
    }
    return "Based on your data, the primary cost driver is Amazon EC2. Focusing on instance optimization and purchasing models like Savings Plans or Reserved Instances would be the most effective way to reduce overall spend.";
}


export const getAnomalyDetails = async (anomaly: Anomaly, context: CostData[], provider: CloudProvider): Promise<{ anomalyDetails: string, recommendations: Recommendation[] }> => {
    if (provider === 'mock') {
        await new Promise(resolve => setTimeout(resolve, 800)); // Simulate AI thinking
        return Promise.resolve(generateMockAnomalyDetails());
    }
    try {
        return await apiRequest('/api/anomaly-details', { anomaly, context });
    } catch (error) {
        console.error("Error getting anomaly details:", error);
        throw new Error("Failed to generate details for the anomaly.");
    }
};

export const askCopilot = async (question: string, history: { role: string, parts: { text: string }[] }[], context: CostData[], provider: CloudProvider): Promise<string> => {
    if (provider === 'mock') {
         await new Promise(resolve => setTimeout(resolve, 1000)); // Simulate AI thinking
         return Promise.resolve(generateMockCopilotResponse(question));
    }
    try {
        const response = await apiRequest('/api/copilot', { question, history, context });
        return response.text;
    } catch (error) {
        console.error("Error asking copilot:", error);
        throw new Error("The FinOps Copilot is currently unavailable. Please try again later.");
    }
};